import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";

function createNote (note) {
    return(
        <Note 
                title = {note.title}
                content = {note.content}
            />
    );
}

function App () {
    return (
        <div>
            <Header />
            <Note 
                title = "merhaba"
                content = "selam"
            />
            <Footer />
        </div>
    );
}

export default App;
